import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Use JavaScript to trigger profile navigation
    await page.evaluate(() => {
      if (typeof showProfile === 'function') {
        showProfile();
      }
    });

    // Wait for profile content to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_loaded.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const usernameEl = document.querySelector('.username');
      const fullNameEl = document.querySelector('.profile-info h2');
      const bioEl = document.querySelector('.bio');

      return {
        username: usernameEl ? usernameEl.textContent.trim() : null,
        fullName: fullNameEl ? fullNameEl.textContent.trim() : null,
        bio: bioEl ? bioEl.textContent.trim() : null
      };
    });

    return {
      success: true,
      action: "Navigated to Jun's profile page",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
